import REturnlogo from './Logo';
// import REturnInPut from './Input';
import REturnInPutCode from './Code';
import REturnQuOte from './Quote';
import './Sign.css';
import REturnArroW from './Arrow';

// view sign export element
export default function REturnSignUp() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};

export const ScreenLarge = () => (
 <div className='wrp-sign-up'>
  <REturnArroW />
  <REturnlogo />
  <REturnQuOte />
  {/* <REturnInPut /> */}
  <REturnInPutCode />

 </div>
);
export const ScreenSmall = () => (
 <div className='wrp-sign-up-sm'>
  <REturnArroW />
  <REturnlogo />
  <REturnQuOte />
  {/* <REturnInPut /> */}
  <REturnInPutCode />

 </div>
);
